package hanhan.entity.goodsEntity.goodsDetail;

public class GoodsDetail {

	private String goodsid="";
    private String weight="";
    private String brandName="";
    private String category="";
    private String goodsname="";
    private String place_production="";
    private String goodsbarcode="";
    private String unit="";
    private String prodescription="";
    private String specification="";
    private String pubflag="";
	public GoodsDetail() {
		super();
		// TODO Auto-generated constructor stub
	}
	public GoodsDetail(String goodsid, String weight, String brandName, String category, String goodsname,
			String place_production, String goodsbarcode, String unit, String prodescription, String specification,
			String pubflag) {
		super();
		this.goodsid = goodsid;
		this.weight = weight;
		this.brandName = brandName;
		this.category = category;
		this.goodsname = goodsname;
		this.place_production = place_production;
		this.goodsbarcode = goodsbarcode;
		this.unit = unit;
		this.prodescription = prodescription;
		this.specification = specification;
		this.pubflag = pubflag;
	}
	public String getGoodsid() {
		return goodsid;
	}
	public void setGoodsid(String goodsid) {
		this.goodsid = goodsid;
	}
	public String getWeight() {
		return weight;
	}
	public void setWeight(String weight) {
		this.weight = weight;
	}
	public String getBrandName() {
		return brandName;
	}
	public void setBrandName(String brandName) {
		this.brandName = brandName;
	}
	public String getCategory() {
		return category;
	}
	public void setCategory(String category) {
		this.category = category;
	}
	public String getGoodsname() {
		return goodsname;
	}
	public void setGoodsname(String goodsname) {
		this.goodsname = goodsname;
	}
	public String getPlace_production() {
		return place_production;
	}
	public void setPlace_production(String place_production) {
		this.place_production = place_production;
	}
	public String getGoodsbarcode() {
		return goodsbarcode;
	}
	public void setGoodsbarcode(String goodsbarcode) {
		this.goodsbarcode = goodsbarcode;
	}
	public String getUnit() {
		return unit;
	}
	public void setUnit(String unit) {
		this.unit = unit;
	}
	public String getProdescription() {
		return prodescription;
	}
	public void setProdescription(String prodescription) {
		this.prodescription = prodescription;
	}
	public String getSpecification() {
		return specification;
	}
	public void setSpecification(String specification) {
		this.specification = specification;
	}
	public String getPubflag() {
		return pubflag;
	}
	public void setPubflag(String pubflag) {
		this.pubflag = pubflag;
	}
	@Override
	public String toString() {
		return "GoodsDetail [goodsid=" + goodsid + ", weight=" + weight + ", brandName=" + brandName + ", category="
				+ category + ", goodsname=" + goodsname + ", place_production=" + place_production + ", goodsbarcode="
				+ goodsbarcode + ", unit=" + unit + ", prodescription=" + prodescription + ", specification="
				+ specification + ", pubflag=" + pubflag + "]";
	}
    
}
